        [TestMethod]
        public void CorrectlyReadNumberOfLockScreensInLog() {
            string base64String = "";
            byte[] myLogFileBytes = Convert.FromBase64String(base64String);
            string myFileName = "mylogFile.json";
            string myPath = Path.Combine("C:\\log", myFileName);
            string myJson = Encoding.UTF8.GetString(myLogFileBytes);

            var creationTime = DateTime.Now.AddHours(-4);
            var fileData = new MockFileData(myJson) {
                CreationTime = creationTime
            };
            var fileSystem = new MockFileSystem(new Dictionary<string, MockFileData>
            {
                {myPath, fileData }
                });
            // FileInfoBase fi = fileSystem.FileInfo.FromFileName(myPath);
            MockFileInfo fi = new MockFileInfo(fileSystem, myPath);
            LockScreenBatchToLog myBatch = new LockScreenBatchToLog(fi, fileSystem);

            // Act

            // Assert

            Assert.AreEqual(2, myBatch.myLockScreens.Count);
        }

        // looks like EnumerateFiles fails when files have no extension, and search pattern is *.
        [TestMethod]
        public void MockFileSystem_EnumerateFiles_ShouldReturnFilesWithNoExtensions() {
            var fs = new MockFileSystem();
            var mf = new MockFileData("my name is Luka");
            string filePath = @"c:\downloadfolder\lyrics";

            fs.AddFile(filePath, mf);
            IEnumerable<string> files = fs.Directory.EnumerateFiles(@"c:\downloadfolder", "*.", SearchOption.TopDirectoryOnly);
            Assert.AreEqual(1, files.Count());
        }

